[Form]
public class VendRequestCompanyProfile extends FormRun
{
    private VendRequestProfile vendRequestProfile;

}

public void run()
{
    super();

    vendRequestProfile = VendRequestProfileHelper::findVendRequestProfile(VendFieldMetadataGroupType::VendProspectiveVendorRegistration, vendProspectiveVendorRegistration.DoingBusinessCountryRegion);
    VendRequestProfileHelper::configureFields(vendRequestProfile.RecId, vendProspectiveVendorRegistration_DS, vendProspectiveVendorRegistration.TableId, true, true);

    VendProspectiveVendorQuestionnaire::updateQuestionnairesForProspectiveVendorRegistration(vendProspectiveVendorRegistration.RecId, vendRequestProfile.RecId);
}

/// <summary>
/// Adds the specified <c>EcoResCategory</c> record for the associated <c>VendProspectiveVendorRegistration</c> record to the <c>VendProspectiveVendorProcurementCategory</c> table.
/// </summary>
/// <param name = "_category">The <c>EcoResCategory</c> to be added.</param>
public void addCategory(EcoResCategory _category)
{
    if (VendProspectiveVendorProcurementCategory::addCategory(_category, vendProspectiveVendorRegistration))
    {
        element.refreshAndUpdateQuestionnaires();
    }
}

public void init()
{
    super();

    if (element.args().record() && element.args().record().RecId)
    {
        QueryBuildRange range = this.queryBuildDataSource().addRange(fieldNum(VendVendorRequest, RecId));
        range.value(queryValue(element.args().record().RecId));
        range.status(RangeStatus::Hidden);
    }
}

public void modified()
{
    if (!taxState.valueStr() || LogisticsAddressState::exist(vendProspectiveVendorRegistration.DoingBusinessCountryRegion, taxState.valueStr()))
    {
        super();
    }
    else
    {
        warning(strFmt(LogisticsAddressState::txtNotExist(), taxState.valueStr()));
    }
}

public int active()
{
    int ret = super();

    // If the category was added after the prospective vendor submitted their registration request, disable the button.
    completeQuestionnaire.enabled(vendProspectiveVendorQuestionnaire.CreatedDateTime >= vendVendorRequest.CreatedDateTime);

    return ret;
}

public void modified()
{
    super();

    ttsbegin;
    vendVendorRequestNewVendor.VendorName = dirPartyTable.Name;
    vendVendorRequestNewVendor_DS.write();
    ttscommit;
}

public void lookup()
{
    ReasonFormTable::reasonCodeLookup(this, LedgerJournalACType::Vend, LedgerJournalACType::Vend, true);
}

public void clicked()
{
    super();

    MultiSelectionHelper multiSelectionHelper = MultiSelectionHelper::construct();
    multiSelectionHelper.parmDatasource(vendProspectiveVendorProcurementCategory_ds);

    VendProspectiveVendorProcurementCategory category = multiSelectionHelper.getFirst();

    while (category.RecId)
    {
        category.delete();
        category = multiSelectionHelper.getNext();
    }

    element.refreshAndUpdateQuestionnaires();
}

void clicked()
{
    VendProspectiveVendorQuestionnaire_KmQuestionnaireRun_Win32 kmQuestionnaireRun = new VendProspectiveVendorQuestionnaire_KmQuestionnaireRun_Win32();

    super();

    kmQuestionnaireRun.setCallingReferences(vendProspectiveVendorQuestionnaire.TableId, vendProspectiveVendorQuestionnaire.RecId);
    kmQuestionnaireRun.setCallerDataSources(vendProspectiveVendorQuestionnaire_DS);

    if (kmQuestionnaireRun.set(KMQuestionnaireRunMode::VendReq, vendProspectiveVendorQuestionnaire.QuestionnaireDefinition, DirPersonUser::current().PersonParty))
    {
        kmQuestionnaireRun.run();
    }
}
